import React from 'react';
import styled from 'styled-components';
import Header from './Header';
import Footer from './Footer';

const SecureCheckout = styled.div`
  background-color: #eef2f4;
  display: flex;
  flex-direction: column;
  min-height: 100vh;
`;

const MainContents = styled.div`
  background-color: #eef2f4;
  display: flex;
  align-self: center;
  width: 100%;
  flex-direction: column;
  align-items: center;
  padding: 21px 0 179px;
`;

const HeaderSection = styled.div`
  position: fixed;
  border-radius: 20px;
  background-color: #f2f2f2;
  display: flex;
  width: 70%;
  overflow: hidden;
  gap: 20px;
  justify-content: space-between;
  padding: 21px 68px;
  box-shadow: 1px 5px 9px 3px rgba(0, 0, 0, 0.147);
  z-index: 1000;
`;

const DividerTop = styled.hr`
  align-self: stretch;
  min-height: 0px;
  margin-top: 100px;
  width: 99.9%;
  border: 1px solid #d5d5d5;
`;

const Divider = styled.hr`
  align-self: stretch;
  min-height: 0px;
  margin-top: 10px;
  width: 99.9%;
  border: 1px solid #d5d5d5;
`;

const BreadcrumbSort = styled.div`
  display: flex;
  width: 100%;
  max-width: 70%;
  gap: 2px;
  flex-wrap: wrap;
  justify-content: space-between;
  margin: 9px 0 0 0px;

  @media (max-width: 991px) {
    width: 70%;
    justify-content: center;
    gap: 2rem;
  }
`;

const Breadcrumb = styled.div`
  align-self: start;
  display: flex;
  gap: 12px;
  color: #000;
  font: 15px Open Sans, sans-serif;
`;

const BreadcrumbItem = styled.span`
  align-self: stretch;
  border-radius: 10px;
  background-color: #fff;
  padding: 4px 14px;
  &.y {
    font: 700 15px Open Sans, sans-serif;
  }
`;

const CheckoutContent = styled.div`
  display: flex;
  margin: 38px 39px;
  gap: 20px;

  @media (max-width: 991px) {
    flex-direction: column;
    margin: 40px 10px;
  }
`;

const ShippingSection = styled.section`
  width: 62%;
  padding: 15px 0;
  background-color: #fff;
  border-radius: 10px;
  padding: 30px;
  margin: 20px;

  @media (max-width: 991px) {
    width: 100%;
    margin: 20px 0;
  }
`;

const SectionTitle = styled.h1`
  font-family: "Open Sans", sans-serif;
  font-size: 20px;
  font-weight: 700;
  margin: 0 0 23px 25px;
`;

const ShippingMethod = styled.div`
  border: 1px solid #e4e4e4;
  border-radius: 10px;
  padding: 20px;
  margin-bottom: 20px;
  cursor: pointer;
  transition: all 0.3s ease;

  &:hover {
    border-color: #0055b6;
  }
`;

const MethodTitle = styled.h3`
  font-family: "Open Sans", sans-serif;
  font-size: 18px;
  font-weight: 600;
  margin-bottom: 10px;
`;

const MethodDescription = styled.p`
  font-family: "Open Sans", sans-serif;
  font-size: 14px;
  color: #666;
  margin-bottom: 10px;
`;

const Price = styled.span`
  font-family: "Open Sans", sans-serif;
  font-weight: 700;
  color: #0055b6;
`;

const ContinueButton = styled.button`
  background-color: #0055b6;
  color: #fff9f9;
  font-weight: 700;
  border: none;
  text-align: center;
  justify-content: center;
  padding: 20px 0;
  align-items: center;
  border-radius: 30px;
  width: 469px;
  max-width: 100%;
  margin-top: 38px;
  cursor: pointer;

  &:hover {
    background-color: #003d82;
  }
`;

const OrderSummary = styled.section`
  width: 38%;
  background-color: #fff;
  border: 1px solid #e4e4e4;
  border-radius: 10px;
  padding: 30px;
  margin: 20px;
  height: fit-content;

  @media (max-width: 991px) {
    width: 100%;
    margin: 20px 0;
  }
`;

const SummaryTitle = styled.h2`
  font-family: "Open Sans", sans-serif;
  font-size: 18px;
  font-weight: 700;
  margin-bottom: 20px;
`;

const ShippingDetails: React.FC = () => {
  return (
    <SecureCheckout>
      <MainContents>
        <Header />

        <DividerTop />

        <BreadcrumbSort>
          <Breadcrumb>
            <BreadcrumbItem className="y">yannstechub</BreadcrumbItem>
            <BreadcrumbItem>/ Shipping</BreadcrumbItem>
          </Breadcrumb>
        </BreadcrumbSort>

        <Divider />

        <CheckoutContent>
          <ShippingSection>
            <SectionTitle>Select Shipping Method</SectionTitle>
            
            <ShippingMethod>
              <MethodTitle>Standard Shipping</MethodTitle>
              <MethodDescription>Delivery in 5-7 business days</MethodDescription>
              <Price>$5.99</Price>
            </ShippingMethod>

            <ShippingMethod>
              <MethodTitle>Express Shipping</MethodTitle>
              <MethodDescription>Delivery in 2-3 business days</MethodDescription>
              <Price>$12.99</Price>
            </ShippingMethod>

            <ShippingMethod>
              <MethodTitle>Next Day Delivery</MethodTitle>
              <MethodDescription>Delivery by end of next business day</MethodDescription>
              <Price>$24.99</Price>
            </ShippingMethod>

            <ContinueButton>
              Continue to Payment
            </ContinueButton>
          </ShippingSection>

          <OrderSummary>
            <SummaryTitle>Order Summary</SummaryTitle>
            <div style={{ 
              fontFamily: '"Open Sans", sans-serif',
              fontSize: '15px',
              lineHeight: '1.6'
            }}>
              <p style={{ marginBottom: '10px' }}>Subtotal: $249.97</p>
              <p style={{ marginBottom: '10px' }}>Shipping: $5.99</p>
              <p style={{ 
                marginTop: '20px',
                fontSize: '18px',
                fontWeight: 'bold'
              }}>Total: $255.96</p>
            </div>
          </OrderSummary>
        </CheckoutContent>
      </MainContents>
      <Footer />
    </SecureCheckout>
  );
};

export default ShippingDetails;
